atom-text-editor[mini].livestyle-mixin__output {
  font-size: 1em;
  background-color: rgba(9, 11, 13, 0.5);
  border: 0;
  box-shadow: inset 0 0 20px rgba(0, 0, 0, 0.5);
  padding: 5px 0;
  line-height: inherit;
  height: auto;
  max-width: none;
}
.livestyle-autocomplete-color {
  display: inline-block;
  width: 1em;
  height: 1em;
  border-radius: 2px;
  box-shadow: 1px 1px 3px rgba(0, 0, 0, 0.3);
  margin-right: 3px;
}
.livestyle-widget-hover::shadow .lines {
  cursor: pointer;
}
atom-text-editor::shadow .gutter-shadow {
  pointer-events: none;
}
atom-text-editor::shadow livestyle-widget {
  color: #d4d7d6;
  border-radius: 4px;
  border-top-left-radius: 0;
  padding: 0 5px;
  position: absolute;
  margin-left: -2px;
  font-size: 0.9em;
  line-height: 1.4;
  box-shadow: 1px 1px 10px rgba(0, 0, 0, 0.5);
  transform-origin: 0 0;
  background: #e37933;
}
atom-text-editor::shadow livestyle-widget::before {
  content: '';
  width: 4px;
  height: 4px;
  display: inline-block;
  position: absolute;
  bottom: 100%;
  left: 0;
}
atom-text-editor::shadow livestyle-widget::before {
  background: radial-gradient(circle farthest-side at 100% 0, transparent 0%, rgba(227, 121, 51, 0) 90%, #e37933 100%);
}
atom-text-editor::shadow livestyle-widget[position*="top"] {
  border-radius: 4px;
  border-bottom-left-radius: 0;
}
atom-text-editor::shadow livestyle-widget[position*="top"]::before {
  transform: scaleY(-1);
  bottom: auto;
  top: 100%;
}
atom-text-editor::shadow livestyle-widget[name="selector"] {
  background: #b55421;
}
atom-text-editor::shadow livestyle-widget[name="selector"]::before {
  background: radial-gradient(circle farthest-side at 100% 0, transparent 0%, rgba(181, 84, 33, 0) 90%, #b55421 100%);
}
atom-text-editor::shadow livestyle-widget[name="variable-suggest"] {
  background: #cbcb41;
}
atom-text-editor::shadow livestyle-widget[name="variable-suggest"]::before {
  background: radial-gradient(circle farthest-side at 100% 0, transparent 0%, rgba(203, 203, 65, 0) 90%, #cbcb41 100%);
}
.theme-atom-material-ui atom-text-editor::shadow livestyle-widget:not([name=variable-suggest]) {
  color: #000;
}
.theme-atom-material-ui atom-text-editor::shadow livestyle-widget[name=variable-suggest] {
  color: #fff;
}
atom-text-editor::shadow livestyle-color-preview {
  display: inline-block;
  border-radius: 2px;
  margin-right: 3px;
  width: 1em;
  height: 1em;
  line-height: 1;
  text-align: center;
  box-shadow: 1px 1px 2px rgba(0, 0, 0, 0.15);
  position: relative;
  top: 1px;
}
atom-text-editor::shadow livestyle-color-preview[approximate]::before {
  content: 'â‰ˆ';
  opacity: 0.8;
  position: absolute;
  left: 0.1em;
  font-size: 1.2em;
  text-shadow: 0px 1px 1px rgba(0, 0, 0, 0.4);
}
atom-text-editor::shadow .livestyle-variable-suggest__title {
  font-size: 1em;
  margin: 0;
  padding: 0.3em 0px;
  white-space: nowrap;
}
atom-text-editor::shadow .livestyle-variable-suggest__item {
  padding: 3px 5px;
  margin: 0 -5px;
  cursor: pointer;
}
atom-text-editor::shadow .livestyle-variable-suggest__item:hover {
  background: rgba(255, 255, 255, 0.2);
}
atom-text-editor::shadow .livestyle-variable-suggest__item:last-child {
  border-bottom-left-radius: 5px;
  border-bottom-right-radius: 5px;
}
atom-text-editor::shadow .livestyle-variable-suggest__varname {
  display: inline-block;
  margin-right: 10px;
  font-weight: bold;
  text-shadow: 1px 1px 0px rgba(0, 0, 0, 0.5);
}
atom-text-editor::shadow .livestyle-variable-suggest__varvalue {
  opacity: 0.6;
  display: inline-block;
  overflow: hidden;
  text-overflow: ellipsis;
  max-width: 200px;
  vertical-align: bottom;
}
atom-text-editor::shadow .livestyle-mixin__hl > .region::before {
  margin-left: -0.8em;
  font-size: 1em;
  width: 1em;
  color: #e37933;
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  content: "\f078";
  transition: transform 0.3s;
  transform-origin: 0.15em 50%;
  will-change: transform;
}
atom-text-editor::shadow .livestyle-mixin__hl_expanded > .region::before {
  transform: rotate(90deg);
}
atom-text-editor::shadow .livestyle-hyperlink_hover .region {
  border-bottom: 1px solid #e37933;
}
atom-text-editor::shadow .livestyle-value-with-suggest .region {
  border-radius: 5px;
  border-bottom: 2px solid #8dc149;
  opacity: 0.5;
  transition: opacity 0.3s;
}
atom-text-editor::shadow .livestyle-value-with-suggest.livestyle-hyperlink_hover .region {
  opacity: 1;
}
atom-panel.modal.livestyle-outline-panel {
  /* max-width: 40em; */
  padding: 0;
}
livestyle-outline {
  padding: 5px 15px;
  position: relative;
  display: block;
}
livestyle-outline::shadow input[name=search] {
  display: block;
  width: 100%;
  background-color: #090b0d;
  color: #d4d7d6;
  outline: none;
  font-size: 1.3em;
  border: 1px solid #090b0d;
  padding: 8px;
  margin-top: 5px;
  box-sizing: border-box;
  -webkit-appearance: none;
}
livestyle-outline::shadow .switch {
  display: block;
  list-style-type: none;
  padding: 0;
  margin: 0.3em 0 0;
  position: absolute;
  top: 13px;
  right: 23px;
  line-height: 1.1;
  text-align: center;
  background: #4d5a5e;
  border-radius: 0;
}
livestyle-outline::shadow .switch > li {
  display: inline-block;
  padding: 5px 8px;
  cursor: pointer;
}
livestyle-outline::shadow .switch > li.selected {
  color: #e37933;
  background: #e37933;
  border-radius: inherit;
}
livestyle-outline::shadow .switch > li[data-target=source]::before {
  content: 'Source';
}
livestyle-outline::shadow .switch > li[data-target=result]::before {
  content: 'Result';
}
livestyle-outline::shadow .section-list {
  max-height: 310px;
  overflow: auto;
  margin: 0 -15px;
  position: relative;
}
livestyle-outline::shadow .section-list section {
  display: none;
  padding: 7px 0;
  overflow: hidden;
}
livestyle-outline::shadow .section-list section.selected {
  display: block;
}
livestyle-outline::shadow .node-label {
  display: block;
  position: relative;
  padding-left: 15px;
  cursor: pointer;
  line-height: 2;
  color: #aaaaaa;
}
livestyle-outline::shadow .node-label-text {
  white-space: nowrap;
  text-overflow: ellipsis;
  overflow: hidden;
  position: relative;
  z-index: 1;
}
livestyle-outline::shadow .node.selected > .node-label::before,
livestyle-outline::shadow .node-label:hover::before {
  display: inline-block;
  content: '';
  position: absolute;
  top: 0;
  bottom: 0;
  left: -50%;
  width: 200%;
  background: #e37933;
}
livestyle-outline::shadow .node:not([data-type="property"]) > .node-label {
  font-weight: bold;
  color: #d4d7d6;
}
livestyle-outline::shadow .node-body {
  padding-left: 20px;
}
livestyle-outline::shadow section.filtered .node:not(.filtered) {
  display: none;
}
livestyle-outline::shadow .highlight {
  color: #e37933;
}
livestyle-outline::shadow .tip {
  color: #e37933;
  margin: 0;
  padding: 20px 0 0;
  font-size: 0.9em;
}
